  true,\n\t\"url\": null,\n\t\"notes\": \"<p>In October 2014, CMS began reducing Medicare
  payments for subsection (d) hospitals that rank in the worst performing quartile
  with respect to hospital-acquired conditions (HACs). Hospitals with a Total HAC
  Score above the 75th percentile of the Total HAC Score distribution may be subject
  to the payment reduction. This table contains a hospitalu00e2u0080u0099s measure,
  domain and Total HAC scores. The measure and domain scores comprise the Total HAC
  Score. In the FY 2016 HAC Reduction Program, hospitals with a Total HAC Score greater
  than 6.7500 are subject to a payment reduction. The hospitals that are subject to
  a payment reduction can be found on <a href=\"https://www.cms.gov/Medicare/Medicare-Fee-for-Service-Payment/AcuteInpatientPPS/HAC-Reduction-Program.html\">https://www.cms.gov/Medicare/Medicare-Fee-for-Service-Payment/AcuteInpat...</a>.</p>n\",\n\t\"license_title\":
